import React from 'react';
import { CommunitySidebar } from './CommunitySidebar';
import { CommunityFeed } from './CommunityFeed';

export function CommunityPage() {
    return (
        <section className="py-12 px-4 animate-fadeIn">
            <div className="text-center mb-12">
                <h1 className="font-orbitron text-4xl md:text-5xl font-bold text-white mb-4 neon-text">
                    Community Hub
                </h1>
                <p className="text-lg md:text-xl text-white/80 max-w-3xl mx-auto">
                    Connect, share ideas, and collaborate with fellow learners. Your journey is better when shared with others.
                </p>
            </div>
            <div className="grid grid-cols-1 lg:grid-cols-3 gap-8 max-w-7xl mx-auto">
                <CommunityFeed />
                <CommunitySidebar />
            </div>
        </section>
    );
}
